class Solution:

    def findPrefixScore(self, nums: List[int]) -> List[int]:
        ans = []
        for i in range(len(nums)):
            prefix = nums[:i + 1]
            conver = []
            for j in range(len(prefix)):
                conver.append(prefix[j] + max(prefix[:j + 1]))
            score = sum(conver)
            ans.append(score)
        return ans

