def random_test(n_limit: int=10 ** 5, num_limit: int=10 ** 9) -> List[List[int]]:

    def gen_input(n_limit: int, num_limit: int) -> List[int]:
        while True:
            n = random.randint(1, n_limit)
            nums = [random.randint(1, num_limit) for _ in range(n)]
            if is_valid_input(nums):
                return nums
    random_inputs = []
    for _ in range(5):
        random_input = gen_input(n_limit, num_limit)
        random_inputs.append(random_input)
    return random_inputs
